import { Fragment } from 'react';
import { Link } from 'react-router-dom';
const EventsPage = () => {
  const DUMMY_EVENT = [
    { id: 1, event: 'some event' },
    { id: 2, event: 'another event' },
  ];
  return (
    <Fragment>
      <ul>
        {DUMMY_EVENT.map((event) => (
          <li>
            <Link to={`/events/${event.id}`}>{event.event}</Link>
          </li>
        ))}
      </ul>
    </Fragment>
  );
};
export default EventsPage;
